OS is none of them. It could be easily replaced by a decentralised exchange.

The leaders could be:
$LYXe  - dece
@Coinbase_NFT -centr

@DPGSpurs @WillSMONG No, I said that a lot of portfolios could have the same transition from Bitcoin + alts to NFT + ETH. I didn't have a 100% transition.

I'd count Real Estate as a different asset with different utility and scarcity. 

I'm not sure about Bonds.
